    "apropos_1": { command: "apropos", section: 1, description: "search man pages", content: "APROPOS(1)                     User Commands                     APROPOS(1)\n\nNAME\n       apropos - search man pages\n\nSYNOPSIS\n       apropos [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       search man pages\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       apropos --help\n              Display help information\n\n       apropos [arguments]\n              Basic usage of apropos\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.aproposrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/apropos>\n       or available locally via: info '(coreutils) apropos invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report apropos translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                APROPOS(1)" },
