    "docker_1": { command: "docker", section: 1, description: "container platform", content: "DOCKER(1)                     User Commands                     DOCKER(1)\n\nNAME\n       docker - Docker container platform\n\nSYNOPSIS\n       docker [OPTIONS] COMMAND [ARG...]\n\nDESCRIPTION\n       Docker is a platform for developers and sysadmins to develop, ship, and run applications using containerization technology.\n\n       Docker Engine is a client-server application with these major components:\n       - A server which is a type of long-running program called a daemon process\n       - A REST API which specifies interfaces that programs can use to talk to the daemon\n       - A command line interface (CLI) client\n\nCOMMANDS\n   Container Commands:\n       run    Run a command in a new container\n       start  Start one or more stopped containers\n       stop   Stop one or more running containers\n       restart\n              Restart one or more containers\n       rm     Remove one or more containers\n       ps     List containers\n       logs   Fetch the logs of a container\n       exec   Run a command in a running container\n       attach Attach local standard input, output, and error streams to a running container\n\n   Image Commands:\n       build  Build an image from a Dockerfile\n       pull   Pull an image or a repository from a registry\n       push   Push an image or a repository to a registry\n       images List images\n       rmi    Remove one or more images\n       tag    Create a tag TARGET_IMAGE that refers to SOURCE_IMAGE\n\n   System Commands:\n       info   Display system-wide information\n       version\n              Show the Docker version information\n       system Commands to manage Docker\n\nOPTIONS\n       --config string\n              Location of client config files (default \"/home/user/.docker\")\n\n       -c, --context string\n              Name of the context to use to connect to the daemon\n\n       -D, --debug\n              Enable debug mode\n\n       -H, --host list\n              Daemon socket(s) to connect to\n\n       -l, --log-level string\n              Set the logging level (debug|info|warn|error|fatal) (default \"info\")\n\n       --tls  Use TLS; implied by --tlsverify\n\n       --tlscacert string\n              Trust certs signed only by this CA (default \"/home/user/.docker/ca.pem\")\n\n       --tlscert string\n              Path to TLS certificate file (default \"/home/user/.docker/cert.pem\")\n\n       --tlskey string\n              Path to TLS key file (default \"/home/user/.docker/key.pem\")\n\n       --tlsverify\n              Use TLS and verify the remote\n\n       -v, --version\n              Print version information and quit\n\nEXAMPLES\n       docker run hello-world\n              Run the hello-world container\n\n       docker run -it ubuntu bash\n              Run Ubuntu container interactively\n\n       docker ps\n              List running containers\n\n       docker ps -a\n              List all containers\n\n       docker images\n              List all images\n\n       docker build -t myapp .\n              Build image from Dockerfile in current directory\n\n       docker run -d -p 80:80 nginx\n              Run nginx in background, map port 80\n\n       docker exec -it mycontainer bash\n              Execute bash in running container\n\n       docker logs mycontainer\n              View container logs\n\n       docker stop mycontainer\n              Stop a running container\n\nFILES\n       ~/.docker/config.json\n              Docker client configuration\n\n       /etc/docker/daemon.json\n              Docker daemon configuration\n\nSEE ALSO\n       docker-run(1), docker-build(1), dockerfile(5)\n\n       Docker documentation: https://docs.docker.com/\n\nAUTHOR\n       Docker, Inc.\n\nDocker 24.0.7                  January 2025                         DOCKER(1)" },
