    "dup_2": { command: "dup", section: 2, description: "duplicate file descriptor", content: "DUP(2)                     System Calls Manual                     DUP(2)\n\nNAME\n       dup - duplicate file descriptor\n\nSYNOPSIS\n       int dup(/* parameters */);\n\nDESCRIPTION\n       The dup() system call duplicate file descriptor.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            DUP(2)" },
    "dup2_2": { command: "dup2", section: 2, description: "duplicate file descriptor", content: "DUP2(2)                     System Calls Manual                     DUP2(2)\n\nNAME\n       dup2 - duplicate file descriptor\n\nSYNOPSIS\n       int dup2(/* parameters */);\n\nDESCRIPTION\n       The dup2() system call duplicate file descriptor.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            DUP2(2)" },
