    "groups_1": { command: "groups", section: 1, description: "print group memberships", content: "GROUPS(1)                     User Commands                     GROUPS(1)\n\nNAME\n       groups - print group memberships\n\nSYNOPSIS\n       groups [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       print group memberships\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       groups --help\n              Display help information\n\n       groups [arguments]\n              Basic usage of groups\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.groupsrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/groups>\n       or available locally via: info '(coreutils) groups invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report groups translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                GROUPS(1)" },
    "gunzip_1": { command: "gunzip", section: 1, description: "decompress files", content: "GUNZIP(1)                     User Commands                     GUNZIP(1)\n\nNAME\n       gunzip - decompress files\n\nSYNOPSIS\n       gunzip [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       decompress files\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       gunzip --help\n              Display help information\n\n       gunzip [arguments]\n              Basic usage of gunzip\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.gunziprc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/gunzip>\n       or available locally via: info '(coreutils) gunzip invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report gunzip translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                GUNZIP(1)" },
