    "hostname_1": { command: "hostname", section: 1, description: "show or set hostname", content: "HOSTNAME(1)                     User Commands                     HOSTNAME(1)\n\nNAME\n       hostname - show or set hostname\n\nSYNOPSIS\n       hostname [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       show or set hostname\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       hostname --help\n              Display help information\n\n       hostname [arguments]\n              Basic usage of hostname\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.hostnamerc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/hostname>\n       or available locally via: info '(coreutils) hostname invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report hostname translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                HOSTNAME(1)" },
    "hosts_5": { command: "hosts", section: 5, description: "host names", content: "HOSTS(5)                     File Formats Manual                     HOSTS(5)\n\nNAME\n       hosts - host names\n\nDESCRIPTION\n       This manual page describes the hosts file format.\n\n       host names\n\nFORMAT\n       The hosts file contains configuration data in a structured format.\n       Each line represents a configuration directive or data entry.\n\nSYNTAX\n       Lines beginning with # are treated as comments and are ignored.\n       Empty lines are also ignored.\n\nFILES\n       /etc/hosts\n              System-wide hosts file\n\n       ~/.hosts\n              User-specific hosts file\n\nEXAMPLES\n       # Example hosts configuration\n       # This is a comment\n       option1=value1\n       option2=value2\n\nSEE ALSO\n       hosts(1), hosts(8), file-hierarchy(7)\n\nNOTES\n       For more detailed information about the hosts file format,\n       consult the system documentation.\n\nLinux                            January 2025                            HOSTS(5)" },
