    "journalctl_1": { command: "journalctl", section: 1, description: "query systemd journal", content: "JOURNALCTL(1)                     User Commands                     JOURNALCTL(1)\n\nNAME\n       journalctl - query systemd journal\n\nSYNOPSIS\n       journalctl [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       query systemd journal\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       journalctl --help\n              Display help information\n\n       journalctl [arguments]\n              Basic usage of journalctl\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.journalctlrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/journalctl>\n       or available locally via: info '(coreutils) journalctl invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report journalctl translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                JOURNALCTL(1)" },
