    "settimeofday_2": { command: "settimeofday", section: 2, description: "set time of day", content: "SETTIMEOFDAY(2)                     System Calls Manual                     SETTIMEOFDAY(2)\n\nNAME\n       settimeofday - set time of day\n\nSYNOPSIS\n       int settimeofday(/* parameters */);\n\nDESCRIPTION\n       The settimeofday() system call set time of day.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            SETTIMEOFDAY(2)" },
    "setuid_2": { command: "setuid", section: 2, description: "set user ID", content: "SETUID(2)                     System Calls Manual                     SETUID(2)\n\nNAME\n       setuid - set user ID\n\nSYNOPSIS\n       int setuid(/* parameters */);\n\nDESCRIPTION\n       The setuid() system call set user id.\n\nRETURN VALUE\n       On success, returns appropriate value. On error, returns -1 and sets errno appropriately.\n\nERRORS\n       EACCES Permission denied.\n       EBADF  Bad file descriptor.\n       EINVAL Invalid argument.\n       ENOMEM Out of memory.\n\nCONFORMING TO\n       POSIX.1-2001, POSIX.1-2008, SVr4, 4.3BSD.\n\nNOTES\n       For more details on system call behavior, consult the system documentation.\n\nSEE ALSO\n       syscalls(2), errno(3), feature_test_macros(7)\n\nCOLOPHON\n       This page is part of release 5.13 of the Linux man-pages project. A description of the project, information about reporting bugs, and the latest version of this page, can be found at https://www.kernel.org/doc/man-pages/.\n\nLinux                            January 2025                            SETUID(2)" },
    "sftp_1": { command: "sftp", section: 1, description: "secure file transfer", content: "SFTP(1)                     User Commands                     SFTP(1)\n\nNAME\n       sftp - secure file transfer\n\nSYNOPSIS\n       sftp [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       secure file transfer\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       sftp --help\n              Display help information\n\n       sftp [arguments]\n              Basic usage of sftp\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.sftprc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/sftp>\n       or available locally via: info '(coreutils) sftp invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report sftp translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                SFTP(1)" },
