    "strings_1": { command: "strings", section: 1, description: "print file strings", content: "STRINGS(1)                     User Commands                     STRINGS(1)\n\nNAME\n       strings - print file strings\n\nSYNOPSIS\n       strings [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       print file strings\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       strings --help\n              Display help information\n\n       strings [arguments]\n              Basic usage of strings\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.stringsrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/strings>\n       or available locally via: info '(coreutils) strings invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report strings translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                STRINGS(1)" },
