    "systemctl_1": { command: "systemctl", section: 1, description: "control systemd", content: "SYSTEMCTL(1)                     User Commands                     SYSTEMCTL(1)\n\nNAME\n       systemctl - control systemd\n\nSYNOPSIS\n       systemctl [OPTION]... [ARGUMENTS]...\n\nDESCRIPTION\n       control systemd\n\nOPTIONS\n       -h, --help\n              display this help and exit\n\n       -V, --version\n              output version information and exit\n\nEXAMPLES\n       systemctl --help\n              Display help information\n\n       systemctl [arguments]\n              Basic usage of systemctl\n\nEXIT STATUS\n       0      if OK,\n       1      if minor problems (e.g., cannot access subdirectory),\n       2      if serious trouble (e.g., cannot access command-line argument).\n\nFILES\n       ~/.systemctlrc\n              User's personal configuration file\n\nSEE ALSO\n       Full documentation <https://www.gnu.org/software/coreutils/systemctl>\n       or available locally via: info '(coreutils) systemctl invocation'\n\nREPORTING BUGS\n       Online help: <https://www.gnu.org/software/coreutils/>\n       Report systemctl translation bugs to <https://translationproject.org/team/>\n\nCOPYRIGHT\n       Copyright © 2023 Free Software Foundation, Inc.  License GPLv3+: GNU GPL version 3 or later <https://gnu.org/licenses/gpl.html>.\n       This is free software: you are free to change and redistribute it.  There is NO WARRANTY, to the extent permitted by law.\n\nAUTHOR\n       Written by the GNU coreutils development team.\n\nGNU coreutils 9.1               January 2025                SYSTEMCTL(1)" },
