"cd_1": { command: "cd", section: 1, description: "change directory", content: "CD(1)                     User Commands                     CD(1)\n\nNAME\n       cd - change directory\n\nSYNOPSIS\n       cd [options] [arguments]\n\nDESCRIPTION\n       change directory\n\n       cd is a shell builtin command. It is built into the shell itself\n       rather than being a separate executable file. The exact behavior may vary\n       between different shells (bash, zsh, sh, etc.).\n\nSHELL BUILTIN\n       This command is typically documented in the man page of your shell.\n       For bash, see bash(1). For zsh, see zshbuiltins(1).\n\nCOMMON USAGE\n       cd                      Change to home directory\n       cd ~                    Change to home directory\n       cd -                    Change to previous directory\n       cd ..                   Change to parent directory\n       cd /path/to/dir         Change to specified directory\n\nEXAMPLES\n       cd /etc                 Change to /etc directory\n       cd ../..                Go up two directory levels\n       cd ~/Documents          Change to Documents in home\n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "bash_1": { command: "bash", section: 1, description: "GNU Bourne-Again Shell", content: "BASH(1)                     User Commands                     BASH(1)\n\nNAME\n       bash - GNU Bourne-Again Shell\n\nSYNOPSIS\n       bash [options] [arguments]\n\nDESCRIPTION\n       GNU Bourne-Again Shell\n\nCOMMON OPTIONS\n       -c command              Execute command and exit\n       -i                      Interactive shell\n       -l, --login             Login shell\n       -s                      Read commands from stdin\n       -n                      Check syntax only\n       -x                      Print commands as executed\n       -e                      Exit on error\n       -u                      Error on undefined variables\n\nSTARTUP FILES\n       /etc/bash.bashrc, ~/.bashrc, ~/.bash_profile\n       \n       \n       \n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "sh_1": { command: "sh", section: 1, description: "POSIX command interpreter", content: "SH(1)                     User Commands                     SH(1)\n\nNAME\n       sh - POSIX command interpreter\n\nSYNOPSIS\n       sh [options] [arguments]\n\nDESCRIPTION\n       POSIX command interpreter\n\nCOMMON OPTIONS\n       -c command              Execute command and exit\n       -i                      Interactive shell\n       -l, --login             Login shell\n       -s                      Read commands from stdin\n       -n                      Check syntax only\n       -x                      Print commands as executed\n       -e                      Exit on error\n       -u                      Error on undefined variables\n\nSTARTUP FILES\n       \n       \n       /etc/profile, ~/.profile\n       \n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
    "zsh_1": { command: "zsh", section: 1, description: "Z shell", content: "ZSH(1)                     User Commands                     ZSH(1)\n\nNAME\n       zsh - Z shell\n\nSYNOPSIS\n       zsh [options] [arguments]\n\nDESCRIPTION\n       Z shell\n\nCOMMON OPTIONS\n       -c command              Execute command and exit\n       -i                      Interactive shell\n       -l, --login             Login shell\n       -s                      Read commands from stdin\n       -n                      Check syntax only\n       -x                      Print commands as executed\n       -e                      Exit on error\n       -u                      Error on undefined variables\n\nSTARTUP FILES\n       \n       /etc/zshrc, ~/.zshrc, ~/.zprofile\n       \n       \n\nSEE ALSO\n       Full documentation is available on systems where this command is installed.\n\n" },
